var f=null;window.onload=()=>{if(f!==null)clearInterval(f);f=setInterval(()=>{const g=document.querySelector("img.ytmusic-player-bar");if(!g)throw new Error("Element not found with query: img.ytmusic-player-bar");const j=g.getAttribute("src");try{fetch("http://localhost:8477",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({music_url:"thumbnail",thumbnail_url:j})})}catch(k){console.warn("Failed to send thumbnail to discord-sdk process",k)}},5000)};
